/* Loop Code */

/* Big thanks to @rico4dev for providing the base start for ATR calcs
I made some tweaks so now the way ATR is calculated matches TradingView :-)
 */

// Set parameters to be used for ATR Period and Multiplier
let Nperiod = 14 // ATR Period
let multiplier = 3 // ATR Multiplier

// Get Current and Previous Candle Data
let currCandle = record.current 
let prevCandle = record.previous 

/* We need to build the price source
For current price there is no problem, we have data
For previous price we must check if exist
Source price is defined as OHCL4*/

// OHCL4 Source for current price
variable.currClose = currCandle.close
variable.ohcl4 = (currCandle.max + currCandle.min + currCandle.close + currCandle.open)/4

// OHCL4 Source for previous candle price - make sure data exists
if (prevCandle === undefined) {
    variable.prevClose = currCandle.close
    variable.prev_ohcl4 = 0    
} else {
    variable.prevClose = prevCandle.close
    variable.prev_ohcl4 = (prevCandle.max + prevCandle.min + prevCandle.close + prevCandle.open)/4
}

/* Define variables we need and build functions */
/* True Range and ATR - Average True Range */

variable.trueRange = calculateTR()
variable.atrNPeriod = calculateATR(Nperiod)
variable.prevAtrNperiod = variable.atrNPeriod // Store ATR value for calcs in RMA

/* To keep lastNperiodTR array to a fixed length
we remove the first element of the array if length is > Nperiod */

variable.lastNPeriodTR.push(calculateTR())
if (variable.lastNPeriodTR.length > Nperiod) {
    variable.lastNPeriodTR.splice(0, 1)
}

/* Calculate ATR */
function calculateATR(length) {
    return calculateRMA(variable.trueRange, length)
}

/* Calculate True Range */
function calculateTR() {
    let hl = currCandle.max - currCandle.min    
    if (variable.prevClose === 0) { return hl } // Return High-Low when previous Close is 0    
    let hcp = Math.abs(currCandle.max - variable.prevClose)
    let lcp = Math.abs(currCandle.min - variable.prevClose)    
    return Math.max(hl, hcp, lcp)
}

/* Calculate RMA */
function calculateRMA(src, length) {    
    if (src.length < length) { return 0 } // We check we have enough values to make the calcs. If not, set value to zero 
    let alpha=1/length // It's a constant
    if (isNaN(variable.prevAtrNperiod)) {
        return 0    
    } else {
        return alpha * src + (1 - alpha) * variable.prevAtrNperiod            
    }  

}

// Build Up Trend function

variable.up = variable.ohcl4 - (multiplier * variable.atrNPeriod)

if (variable.last2uptrend.length > 2) {
    variable.last2uptrend.splice(0, 1)
}

variable.up1 = variable.last2uptrend[variable.last2uptrend.length - 1] // Previous Up Trend 

variable.uptrend = calculateUpTrend()

variable.last2uptrend.push(variable.uptrend) 

function calculateUpTrend() {
    if (variable.prevClose > variable.up1) {
        return Math.max(variable.up, variable.up1)
    } else {
        return variable.up
    }
}

// Build Down Trend function

variable.dn = variable.ohcl4 + (multiplier * variable.atrNPeriod)

if (variable.last2downtrend.length > 2) {
    variable.last2downtrend.splice(0, 1)
}

variable.dn1 = variable.last2downtrend[variable.last2downtrend.length - 1] // Previous Down Trend

variable.downtrend = calculateDnTrend()

variable.last2downtrend.push(variable.downtrend) 

function calculateDnTrend() {
    if (variable.prevClose < variable.dn1) {
        return Math.min(variable.dn, variable.dn1)
    } else {
        return variable.dn
    }
}


// Build Trend function

if (variable.last2Trend.length > 2) {
    variable.last2Trend.splice(0, 1)
}

variable.prevTrend = variable.last2Trend[variable.last2Trend.length - 1]

variable.trend = calculateTrend()

variable.last2Trend.push(variable.trend)

function calculateTrend() {

    if (variable.trend = -1 && variable.currClose > variable.dn1) {
        return 1
    }
    else if (variable.trend = 1 && variable.currClose < variable.up1) {
        return -1
    }    
    else {
        return variable.prevTrend
    }
}

// End of code :-)

/* Initialization Code*/

//// Arrays to store past data
variable.lastNPeriodTR = []
variable.last2uptrend = [0]
variable.last2downtrend = [0]
variable.last2Trend = [0]

// Initialize trend
variable.trend = 1

/* Loop Code */
// * NOTE * - Lookback to start is 6 - That means 6 previous before current.
let candle = record.current;

let hl2 = (candle.max + candle.min) / 2;  // (high + low) / 2
let hl2ArrLen = variable.hl2Arr.push(hl2);
if (hl2ArrLen > 16) {
    variable.hl2Arr.splice(0, 13);  // Bring back to length == 4
    hl2ArrLen = variable.hl2Arr.length;
}

if (hl2ArrLen < 4) {
    variable.mama = 0;
    variable.fama = 0;
} else {
    let sp = ( (4 * hl2) +
        (3 * variable.hl2Arr[hl2ArrLen-2]) +
        (2 * variable.hl2Arr[hl2ArrLen-3]) +
        (variable.hl2Arr[hl2ArrLen-4])) / 10;

    let spArrLen = variable.spArr.push(sp);
    if (spArrLen > 16) {
        variable.spArr.splice(0,10);
        spArrLen = variable.spArr.length;
    }

    let dt = (.0962 * sp +
            .5769 * variable.spArr[spArrLen-3] -
            .5769 * variable.spArr[spArrLen-5] -
            .0962 * variable.spArr[spArrLen-7]) *
            (.075 * variable.pPrev + .54);
    let dtArrLen = variable.dtArr.push(dt);
    if (dtArrLen > 16) {
        variable.dtArr.splice(0,10);
        dtArrLen = variable.dtArr.length;
    }

    let q1 = (.0962 * dt +
            .5769 * variable.dtArr[dtArrLen-3] -
            .5769 * variable.dtArr[dtArrLen-5] -
            .0962 * variable.dtArr[dtArrLen-7]) *
            (.075 * variable.pPrev + .54);
    let q1ArrLen = variable.q1Arr.push(q1);
    if (q1ArrLen > 16) {
        variable.q1Arr.splice(0,10);
        q1ArrLen = variable.q1Arr.length;
    }

    let i1 = variable.dtArr[dtArrLen-4];
    let i1ArrLen = variable.i1Arr.push(i1);
    if (i1ArrLen > 16) {
        variable.i1Arr.splice(0,10);
        i1ArrLen = variable.i1Arr.length;
    }

    let jI = (.0962 * i1 +
            .5769 * variable.i1Arr[i1ArrLen-3] -
            .5769 * variable.i1Arr[i1ArrLen-5] -
            .0962 * variable.i1Arr[i1ArrLen-7]) *
            (.075 * variable.pPrev + .54);

    let jq = (.0962 * q1 +
            .5769 * variable.q1Arr[q1ArrLen-3] -
            .5769 * variable.q1Arr[q1ArrLen-5] -
            .5769 * variable.q1Arr[q1ArrLen-7]) *
            (.075 * variable.pPrev + .54);

    let i2_ = i1 - jq;
    let q2_ = q1 + jI;
    let i2 = .2 * i2_ + .8 * variable.i2Prev;
    let q2 = .2 * q2_ + .8 * variable.q2Prev;
    let re_ = i2 * variable.i2Prev + q2 * variable.q2Prev;
    let im_ = i2 * variable.q2Prev - q2 * variable.i2Prev;
    let re = .2 * re_ + .8 * variable.rePrev;
    let im = .2 * im_ + .8 * variable.imPrev;

    let p1 = (im != 0 && re != 0) ? (360/Math.atan(im/re)) : variable.pPrev;

    let p2 = (p1 > (1.5 * variable.p1Prev)) ? 
            (1.5 * variable.p1Prev) :
            (p1 < 0.67 * variable.p1Prev) ?
            (0.67 * variable.p1Prev) : p1;

    let p3 = (p2 < 6) ? 6 :
            (p2 > 50) ? 50 : p2;

    let p = .2 * p3 + .8 * variable.p3Prev;

    let spp = .33 * p + .67 * variable.sppPrev;
    let phase = Math.atan(q1 / i1);
    let dphase_ = variable.phasePrev - phase;
    let dphase = (dphase_ < 1) ? 1 : dphase_;
    let alpha_ = variable.fastLimit / dphase;

    let alpha = (alpha_ < variable.slowLimit) ?
                variable.slowLimit :
                (alpha_ > variable.fastLimit) ?
                variable.fastLimit : alpha_;

    /* mama && fama variable declarations: */            
    variable.mama = alpha * hl2 + (1 - alpha) * variable.mamaPrev;
    variable.fama = .5 * alpha * variable.mama + (1 - .5 * alpha) * variable.famaPrev;

    /* Load up variable.Prevs */
    variable.pPrev = p;
    variable.i2Prev = i2;
    variable.q2Prev = q2;
    variable.rePrev = re;
    variable.imPrev = im;
    variable.p1Prev = p1;
    variable.p3Prev = p3;
    variable.sppPrev = spp;
    variable.phasePrev = phase;
    variable.mamaPrev = variable.mama;
    variable.famaPrev = variable.fama;
}

if (!isFinite(variable.mama)) {
    variable.mama = (isFinite(variable.mamaPrev) ? variable.mamaPrev :
    ((candle.close + candle.max + candle.min) / 3));
}
if (!isFinite(variable.fama)) {
    variable.fama = (isFinite(variable.famaPrev) ? variable.famaPrev :
    ((candle.close + candle.max + candle.min) / 3));
}
variable.closePrice = candle.close;

/* Initialization Code */
variable.fastLimit = 0.375;  // Orig Setting:0.5
variable.slowLimit = 0.0375; // Orig Setting:0.05
variable.hl2Arr = [];        // Max Length == 16
variable.spArr = [0,0,0,0,0,0];         // Max Length == 16
variable.dtArr = [0,0,0,0,0,0];         // Max Length == 16
variable.q1Arr = [0,0,0,0,0,0];         // Max Length == 16
variable.i1Arr = [0,0,0,0,0,0];         // Max Length == 16
variable.pPrev = 0;
variable.i2Prev = 0;
variable.q2Prev = 0;
variable.rePrev = 0;
variable.imPrev = 0;
variable.p1Prev = 0;
variable.p3Prev = 0;
variable.sppPrev = 0;
variable.phasePrev = 0;
variable.mamaPrev = 0;
variable.famaPrev = 0;

let candle = record.current
let MAMA_PLUV = getElement('MAMAs', candle)
let P = 10 //periodes for ATR calculation

//True range
variable.TR.push(Math.max((candle.max - candle.min), Math.abs(candle.max - candle.close),Math.abs(candle.min-candle.close)))
if(variable.TR.length > P) {
	variable.TR.splice(0,1)
}

//ATR
variable.ATR = 0
for(var i=0 ; i < variable.TR.length ; i++){
		variable.ATR += variable.TR[i]
}
variable.ATR = variable.ATR / P
//put your mama in a local variable... 
if(MAMA_PLUV.mama === undefined){
	variable.MAMA = candle.close
}
else {
	variable.MAMA = MAMA_PLUV.mama
}
//calculate Upper and Lower Band for Keltner channels
if(variable.ATR === undefined || isNaN(variable.ATR)){
	variable.Upper = variable.MAMA
	variable.Lower = variable.MAMA
}
else{
	variable.Upper = variable.MAMA + 2 * variable.ATR
	variable.Lower = variable.MAMA - 2* variable.ATR
}

let candle = record.current
let P = 10 //periodes for ATR calculation
let len = 20 // periods for EMA calculation

//Manage previousEMA undefined value
if (variable.previousEMA === undefined) {
	variable.previousEMA = candle.close
}

//True range
variable.TR.push(Math.max((candle.max - candle.min), Math.abs(candle.max - candle.close), Math.abs(candle.min - candle.close)))
if (variable.TR.length > P) {
	variable.TR.splice(0, 1)
}

//ATR
variable.ATR = 0
for (var i = 0; i < variable.TR.length; i++) {
	variable.ATR += variable.TR[i]
}
variable.ATR = variable.ATR / P

//calculate ema
variable.ema = calculateEMA(len, candle.close, variable.previousEMA)
variable.previousEMA = variable.ema
//calculate Upper and Lower Band for Keltner channels
if (variable.ATR === undefined || isNaN(variable.ATR)) {
	variable.Upper = variable.ema
	variable.Lower = variable.ema
}
else {
	variable.Upper = variable.ema + 2 * variable.ATR
	variable.Lower = variable.ema - 2 * variable.ATR
}

//EMA calculation
function calculateEMA(periods, price, previousEMA) {
	let k = 2 / (periods + 1)
	return price * k + previousEMA * (1 - k)
}

let candle = record.current
let len = 20 //periods for EMA calculation
let m = 2 //factor for standard deviation
let A = 20 //volatility analysis periods

//fetching last len typical price
variable.TP = (candle.max + candle.min + candle.close) / 3
variable.last20TP.push(variable.TP)
if (variable.last20TP.length > len) {
	variable.last20TP.splice(0, 1)
}
variable.sTP = 0
variable.sTPSquare = 0
for (var i = 0; i < len; i++) {
	variable.sTP += variable.last20TP[i]
}
//calculate MA
if (variable.last20TP.length === 20) {
	variable.MA = variable.sTP / variable.last20TP.length
	variable.sigma = Math.sqrt(variable.sTPSquare / variable.last20TP.length)
} else {
	variable.MA = variable.TP
}

//calculate standard deviation
if (variable.last20TP.length === 20) {
	for (var i = 0; i < len; i++) {
		variable.sTPSquare += Math.pow(variable.last20TP[i] - variable.MA, 2)
	}
	variable.sigma = Math.sqrt(variable.sTPSquare / variable.last20TP.length)
} else {
	variable.sigma = variable.MA * 0.01
}

//calculate Upper and lower Bollinger Bands
variable.up = variable.MA + m * variable.sigma
variable.low = variable.MA - m * variable.sigma

//ATR
let candle = record.current
let P = 5 //periods for ATR

if(variable.prevClose === undefined){
	variable.prevClose = candle.close
}

variable.TR.push(Math.max((candle.max - candle.min), Math.abs(candle.max - variable.prevClose), Math.abs(candle.min - variable.prevClose)))
if(variable.TR.length > P){
	variable.TR.splice(0,1)
}

